import { styled } from "styled-components";

export const TopBar = styled.div`
  width: 85%;
  height: 50px;
  padding: 20px;
  display: flex;
`;
export const Title = styled.div`
  font-size: 18px;
  font-weight: 400;
  line-height: 25px;
  letter-spacing: 0em;
  text-align: center;
  color: #333333;

  width: 100%;
  background: transparent;
`;

